cell::UnsafeCell::<T>::get.doc:
Gets a mutable pointer to the wrapped value.

This can be cast to a pointer of any kind. When creating references, you must uphold the
aliasing rules; see [the type-level docs][UnsafeCell#aliasing-rules] for more discussion and
caveats.

# Examples

```
use std::cell::UnsafeCell;

let uc = UnsafeCell::new(5);

let five = uc.get();
```

option::Option::<T>::insert.doc:
Inserts `value` into the option, then returns a mutable reference to it.

If the option already contains a value, the old value is dropped.

See also [`Option::get_or_insert`], which doesn't update the value if
the option already contains [`Some`].

# Example

```
let mut opt = None;
let val = opt.insert(1);
assert_eq!(*val, 1);
assert_eq!(opt.unwrap(), 1);
let val = opt.insert(2);
assert_eq!(*val, 2);
*val = 3;
assert_eq!(opt.unwrap(), 3);
```

